const HOME = 'HOME';

const initialState = {
     socImages: [
  {facebook:''},
  {instagram:''},
  {github:'github'},
  {gmail:'gmail'},
  {youtube:'youtube'},

]
}

export default function appReducer(state = initialState, action) {

  switch (action.type) {
    default:

      return state;
  }
}
